  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Trempealeau
  National Wildlife Refuge summarizes Refuge activities during the 1993 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ Land acquisition is also covered.  The report includes a planning section which
  discusses the master plan, public participation, compliance with environmental and
  cultural resource mandates, research, and investigations.  Refuge administration
  is outlined; information about personnel, manpower programs, volunteer programs,
  funding, safety, and technical assistance is given.  Habitat management is also
  covered.  Subjects include wetlands, forests, grasslands, haying, fire management,
  pest control, Farmers Home Administration Easements, and private lands.  The wildlife
  section of the report discusses wildlife diversity, endangered species, threatened
  species, waterfowl, marsh birds, water birds, shorebirds, raptors, game mammals,
  fisheries resources, and marking/banding.  The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
  trapping, wildlife observation, camping, and law enforcement.  The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment utilization/replacement, and computer systems.  Cooperative
  programs are provided at the end; Refuge brochures are attached.\",\n\t\"owner_org\":
